import React, { useState } from 'https://cdn.skypack.dev/react';
import ReactDOM from 'https://cdn.skypack.dev/react-dom';
import { 
  Button, 
  TextField, 
  Box
} from 'https://cdn.skypack.dev/@material-ui/core';
import { MenuItem } from 'https://cdn.skypack.dev/@material-ui/core';
import { Select } from 'https://cdn.skypack.dev/@material-ui/core';

const DynamicForm = ({ data, updateData, runQuery }) => {
  const [formData, setFormData] = useState(data.formData || [{
    drugName: '',
    dosage: '',
    notes: ''
  }]);

  const handleAddPrescription = () => {
    setFormData([...formData, {
      drugName: '',
      dosage: '',
      notes: ''
  }]);
  };

  const handleRemovePrescription = (index) => {
    const newData = formData.filter((_, i) => i !== index);
    setFormData(newData);
    updateData({ formData: newData });
  };

  const handleInputChange = (index, field, value) => {
    const newData = [...formData];
    newData[index] = { ...newData[index], [field]: value };
    setFormData(newData);
    updateData({ formData: newData });
  };

  return (
    <Box style={{ padding: '10px' }}>
       <Box style={{ display: 'flex', gap: '5px', marginTop: '0px' }}> 
    <h1 style={{paddingLeft: '10px', fontFamily: 'sans-serif', fontSize: '18px', fontWeight: 'bold'}}>
        Prescribe Medication
    </h1>
    </Box>
      <div style={{ maxHeight: '300px', overflowY: 'auto' }}>
        {formData.map((prescription, index) => (
          <Box key={index} style={{ 
            display: 'flex', 
            flexWrap: 'wrap',
            gap: '5px', 
            marginBottom: '10px',
            padding: '10px',
            border: '1px solid #eee',
            borderRadius: '4px'
          }}>
            <TextField
              size="small"
              label="Drug Name"
              value={prescription.drugName}
              onChange={(e) => handleInputChange(index, 'drugName', e.target.value)}
              style={{ flex: '1 1 200px' }}
            />
            <TextField
              size="small"
              label="Dosage"
              value={prescription.dosage}
              onChange={(e) => handleInputChange(index, 'dosage', e.target.value)}
              style={{ flex: '1 1 100px' }}
            />
             <TextField
              size="small"
              label="Notes"
              value={prescription.notes}
              onChange={(e) => handleInputChange(index, 'notes', e.target.value)}
              style={{ flex: '1 1 150px' }}
            />
            <Button
              size="small"
              color="secondary"
              onClick={() => handleRemovePrescription(index)}
              disabled={formData.length === 1}
              style={{ alignSelf: 'flex-start' }}
            >
              X
            </Button>
          </Box>
        ))}
      </div>

      <Box style={{ display: 'flex', gap: '5px', marginTop: '10px' }}>
        <Button
          size="small"
          variant="contained"
          color="primary"
          onClick={handleAddPrescription}
        >
          Add Prescription
        </Button>
      </Box>
    </Box>
  );


};

const ConnectedComponent = Tooljet.connectComponent(DynamicForm);
ReactDOM.render(<ConnectedComponent />, document.body);

import React, { useState } from 'https://cdn.skypack.dev/react';
import ReactDOM from 'https://cdn.skypack.dev/react-dom';
import { TextField, Box, FormControl, InputLabel, Select, MenuItem } from 'https://cdn.skypack.dev/@material-ui/core';

const Diagnosis = ({ data, updateData }) => {
  const [text, setText] = useState(data.text || '');
  const [selectedDisease, setSelectedDisease] = useState(data.selectedDisease || '');

  const diseaseOptions = [
  { value: 'none', label: 'Select Disease' },
  { value: 'none', label: 'None' },
  { value: 'allergy', label: 'Allergies' },
  { value: 'asthma', label: 'Asthma' },
  { value: 'cold', label: 'Common Cold' },
  { value: 'covid', label: 'COVID-19' },
  { value: 'flu', label: 'Influenza (Flu)' },
  { value: 'others', label: 'Others' }
];

  const handleTextChange = (e) => {
    const newValue = e.target.value;
    setText(newValue);
    // Update BOTH text and selectedDisease in ToolJet data
    updateData({ ...data, text: newValue });
  };

  const handleDiseaseChange = (e) => {
    const newDisease = e.target.value;
    setSelectedDisease(newDisease);
    // Update BOTH text and selectedDisease in ToolJet data
    updateData({ ...data, selectedDisease: newDisease });
  };

  return (
    <Box style={{ padding: '10px' }}>
      <FormControl fullWidth margin="normal">
        <InputLabel id="disease-select-label">Select Disease</InputLabel>
        <Select
          labelId="disease-select-label"
          id="disease-select"
          value={selectedDisease}
          onChange={handleDiseaseChange}
        >
          {diseaseOptions.map((option) => (
            <MenuItem key={option.value} value={option.value}>
              {option.label}
            </MenuItem>
          ))}
        </Select>
      </FormControl>
      <TextField
        label="Enter Diagnosis"
        multiline
        rows={15}
        variant="outlined"
        fullWidth
        value={text}
        onChange={handleTextChange}
        style={{ textwrap: 'wrap' }}
      />
    </Box>
  );
};

const ConnectedComponent = Tooljet.connectComponent(Diagnosis);
const container = document.getElementById('root') || document.body;
ReactDOM.render(<ConnectedComponent />, container);

