  };

  const handleInputChange = (index, field, value) => {
    const newData = [...formData];
    newData[index] = { ...newData[index], [field]: value };
    setFormData(newData);
    updateData({ formData: newData });
  };

  const handleSubmit = () => {
    runQuery(data.getDataform);
  }; 

  return (
