              label="Duration"
              value={prescription.duration}
              onChange={(e) => handleInputChange(index, 'duration', e.target.value)}
              style={{ flex: '1 1 150px' }}
            />
            <TextField
              size="small"
              label="Frequency"
              value={prescription.frequency}
              onChange={(e) => handleInputChange(index, 'frequency', e.target.value)}
