// Gather styles from the current page
var styles = document.querySelectorAll('link, style');
var stylesHtml = "";
for (var i = 0; i < styles.length; i++) {
  stylesHtml += styles[i].outerHTML;
}

// Add A5 portrait and pagination styles
stylesHtml += `
  <style>
    @page { 
      size: A5 portrait; 
      margin: 8mm; 
    }
    body {
      font-family: Arial, sans-serif;
      font-size: 12pt;
      line-height: 1.5;
      margin: 0;
      padding: 0;
    }
    .page {
      width: 148mm;
      height: auto;
      padding: 8mm; 
      position: relative;
      page-break-after: always;
    }
    .page:last-of-type {
      page-break-after: auto; 
    }
    .header {
      display: flex;
      justify-content: space-between;
      margin: 0; 
    }
    .header-left, .header-right {
      width: 45%;
    }
    .transcript {
      height: auto; 
      word-wrap: break-word;
      white-space: pre-wrap; 
      margin-bottom: 0; 
    }
    .transcript p {
      margin: 2px 0;
    }
    .medication-table {
      width: 100%;
      border-collapse: collapse;
      margin: 10px 0;
    }
    .medication-table th, .medication-table td {
      border: 1px solid black;
      padding: 5px;
      text-align: left;
    }
    .medication-table th {
      background-color: #f2f2f2;
    }
    .signature {
      display: none; 
    }
    .page:last-of-type .signature {
      display: block;
      position: absolute;
      bottom: 8mm; 
      right: 8mm;
      width: 60mm;
      text-align: right;
    }
    .signature hr {
      border: 0;
      border-top: 1px solid black;
      margin-top: 5px;
    }
  </style>
`;

// Calculate age from dob (assuming variables.dob is YYYY-MM-DD or a Date object)
var dob = queries.getPatientsAge.data[0].dob ? new Date(queries.getPatientsAge.data[0].dob) : new Date();
var today = new Date();
var age = today.getFullYear() - dob.getFullYear();
var monthDiff = today.getMonth() - dob.getMonth();
if (monthDiff < 0 || (monthDiff === 0 && today.getDate() < dob.getDate())) {
  age--;
}

var formattedDate = today.toLocaleDateString('en-US', { year: 'numeric', month: 'long', day: 'numeric' });

// Process JSON data
var consultation = queries.getFullTranscript.data[0] || {};
var diagnosis = consultation.diagnosis || 'N/A';
var actions = consultation.actions || 'N/A';
var notes = consultation.notes || 'N/A';
var medications = Array.isArray(consultation.medication) ? consultation.medication : [];

// Build medication table
var medicationTable = `
  <table class="medication-table">
    <tr>
      <th>Drug Name</th>
      <th>Dosage</th>
      <th>Notes</th>
    </tr>
`;
if (medications.length > 0) {
  medications.forEach(function(med) {
    medicationTable += `
      <tr>
        <td>${med.drugName || 'N/A'}</td>
        <td>${med.dosage || 'N/A'}</td>
        <td>${med.notes || 'N/A'}</td>
      </tr>
    `;
  });
} else {
  medicationTable += `
    <tr>
      <td colspan="3">No medications prescribed.</td>
    </tr>
  `;
}
medicationTable += `</table>`;

// Format transcript content
var transcriptContent = `
  <p><strong>Diagnosis:</strong> ${diagnosis.replace(/\n/g, '<br>')}</p>
  <p><strong>Medications:</strong></p>
  ${medicationTable}
  <p><strong>Actions:</strong> ${actions}</p>
  <p><strong>Notes:</strong> ${notes}</p>
`;

var printContents = `
  <div class="page last-page">
    <div class="header">
      <div class="header-left">
        <p><strong>Name:</strong> ${queries.getAPDetailByAID.data[0].givenname || 'N/A'} ${queries.getAPDetailByAID.data[0].familyname || 'N/A'}</p>
        <p><strong>ID:</strong> ${queries.getAPDetailByAID.data[0].n_id || components.patientCalendar.selectedEvent.aid || 'N/A'}</p>
      </div>
      <div class="header-right">
        <p><strong>Date:</strong> ${formattedDate}</p>
        <p><strong>Age:</strong> ${age || 'N/A'}</p>
      </div>
    </div>
    <div class="transcript">
      ${transcriptContent}
    </div>
    <div class="signature">
      <p><strong>Dr. ${queries.getAPDetailByAID.data[0].dgivenname || 'N/A'} ${queries.getAPDetailByAID.data[0].dfamilyname || 'N/A'}</strong></p>
      <hr>
    </div>
  </div>
`;

var winPrint = window.open("", "", "width=600,height=800");

winPrint.document.write(
  `<html>
    <head>
      ${stylesHtml}
    </head>
    <body>
      ${printContents}
    </body>
  </html>`
);

winPrint.document.close();
winPrint.focus();
winPrint.print();
winPrint.close();

